import React from "react";
const Name=(props)=>{
    let x=props
    
        if(props.x==props.y && props.y==props.z){
            return (
                <>
                <p>This is matcing 
                <br/>
                {props.x} {props.y} {props.z}</p>
                </>
            )
        }
        else{
            return (
                <>
                <p>This is not matching<br/>
                {props.x} {props.y} {props.z}</p>
                </>
            )
        }
}
export default Name;
